import * as React from 'react';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';
import Slider from '@mui/material/Slider';
import MuiInput from '@mui/material/Input';
import Input from '@mui/material/Input';


export default function Calculator () {
    const [value, setValue] = React.useState(30);

  const handleSliderChange = (event: Event, newValue: number | number[]) => {
    setValue(newValue as number);
  };

  const handleInputChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    setValue(event.target.value === '' ? 0 : Number(event.target.value));
  };

  const handleBlur = () => {
    if (value < 0) {
      setValue(0);
    } else if (value > 100) {
      setValue(100);
    }
  };
  return (
    <div className="calculator">
        <h1 className="content__head navigation-cart__content-head content__head__headOne">
            Calculator online
        </h1>
        <div className="calculator-block">
            <div className="choice-items">
                <div className="choice-item">
                    <p className="choice-name choice-item__choice-name">
                        Select room type
                    </p>
                    <select className="choice-selected" >
                        <option value="Room">Room</option>
                        <option value="Studio apartment">Studio apartment</option>
                        <option value="1-room apartment">1-room apartment</option>
                        <option value="2-room apartment">2-room apartment</option>
                        <option value="3-room apartment">3-room apartment</option>
                        <option value="4-room apartment">4-room apartment</option>
                        <option value="5-room apartment">5-room apartment</option>
                        <option value="House, townhouse">House, townhouse</option>
                    </select>
                </div>
                <div className="choice-item">
                    <p className="choice-name choice-item__choice-name">
                        Specify the footage of the room
                    </p>
                    
                    <Input
                        value={value}
                        size="small"
                        onChange={handleInputChange}
                        onBlur={handleBlur}
                        inputProps={{
                        step: 20,
                        min: 0,
                        max: 200,
                        type: 'number',
                        'aria-labelledby': 'input-slider',
                        }}
                    />
                    <Slider
                        value={typeof value === 'number' ? value : 0}
                        onChange={handleSliderChange}
                        aria-labelledby="input-slider"
                    />
                </div>
                <div className="choice-block">
                    <h3 className="head choice-block__head">
                        What you will need in a design project
                    </h3>
                    <div className="choice-inputs">
                        <div className="choice-inputs-item">
                            <input type="checkbox" name="" id="" />
                            <p className="input-text">3D visualization </p>
                        </div>
                        <div className="choice-inputs-item">
                            <input type="checkbox" name="" id="" />
                            <p className="input-text">Discounted products</p>
                        </div>
                        <div className="choice-inputs-item">
                            <input type="checkbox" name="" id="" />
                            <p className="input-text">Account of overhaul </p>
                        </div>
                        <div className="choice-inputs-item">
                            <input type="checkbox" name="" id="" />
                            <p className="input-text">Planning solution</p>
                        </div>
                        <div className="choice-inputs-item">
                            <input type="checkbox" name="" id="" />
                            <p className="input-text">Drawings </p>
                        </div>
                        <div className="choice-inputs-item">
                            <input type="checkbox" name="" id="" />
                            <p className="input-text">Custom-made furniture </p>
                        </div>
                        <div className="choice-inputs-item">
                            <input type="checkbox" name="" id="" />
                            <p className="input-text">Gazette (shopping list)</p>
                        </div>
                    </div>
                </div>
            </div>
            <div className="itog-price-block">
                <div className="itog-price-head">
                    <h3 className='head-text'>DESIGN PROJECT COST</h3>
                    <h2 className='price-sum'>47 900 Руб</h2>
                    <p className='prhead-desc'>1000 ₽ per m²</p>
                    <p className='prhead-desc'>The design project will be ready in 35-45 days</p>
                </div>
                <div className="itog-price-body">
                    <h3 className='body-text-dop'>В ДИЗАЙН-ПРОЕКТ ВКЛЮЧЕНО:</h3>
                    <div className="dop-item">
                        <h2 className='dop-item-text'>3 планировочных решения</h2>
                        <p className='dop-item-price'>2 000 ₽</p>
                    </div>
                    <button className="btn btn__zakaz">Заказать проект</button>
                </div>
            </div>
        </div>
    </div>
  );
}
